function bubbleSort(arr) {
	for (let i = arr.length; i > 0; i--) {
		for (var j = 0; j < i - 1; j++) {
			if (arr[j] > arr[j + 1]) {
				let temp = arr[j];
				arr[j] = arr[j + 1];
				arr[j + 1] = temp;
			}
		}
	}
}

bubbleSort(arr)

function selectionSort(arr) {
for (let i = 0; i < arr.length; i++) {
	let minIndex = i;
	for (let j = i + 1; j < arr.length; j++) {
		if (arr[j] < arr[minIndex]) {
			minIndex = j;
		}
	}
	if (minIndex !== i) {
		let temp = arr[i];
		arr[i] = arr[minIndex];
		arr[minIndex] = temp;
	}
}

selectionSort(arr)
